  if (obj == null) {
    return false;
  }

  if (this.getClass() == obj.getClass()) {
    VersionedFileStatus other = (VersionedFileStatus) obj;
    return this.getPath().equals(other.getPath()) && this.version.equals(other.version);
  }

  return false;
}
